import React from "react";

const Navbar = () => {
  return (
    <nav style={styles.navbar}>
      <a href="/" style={styles.navItem}>
        Home
      </a>
      <a href="/register" style={styles.navItem}>
        Register
      </a>
      <a href="/login" style={styles.navItem}>
        Login
      </a>
    </nav>
  );
};

const styles = {
  navbar: {
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center",
    padding: "10px 40px", // Wider padding
    backgroundColor: "#333",
  },
  leftItems: {
    flex: 1,
  },
  rightItems: {
    display: "flex",
    gap: "20px", // Space between Register and Login
  },
  navItem: {
    color: "white",
    textDecoration: "none",
    fontSize: "18px",
  },
};

export default Navbar;
